import numpy as np
class stack(object):
    def __init__(self):
        self.topindex = -1
        self.empty = 1
        self.max = 2**15-1
        #self.element = [0 for i in range(0,self.max)]
        self.element = np.zeros((1,self.max))
    def push(self,char_c):
        if self.topindex != self.max - 1:
           self.topindex += 1
           self.element[self.topindex] = char_c
           self.empty = -1
    def pop(self):
        if self.topindex != -1:
            elem = self.element[self.topindex]
            self.topindex -= 1
            return elem
        else:
            return None
    def isempty(self):
        if self.empty == 1 or self.topindex == -1:
            return True 
        else:
            return False 

    def top(self):
        if self.topindex == -1:
            return None
        else:
            return self.element[self.topindex]

    def tranverse(self):
        print(self.element)
            
        
class Solution(object):
    def isValid(self, s):
        """
        :type s: str
        :rtype: bool
        """
        stk = stack()
        
        hmap = {'[': ']', '{':'}', '(':')'}
        
        if s == "":
            return False

        for i in s:
            if stk.isempty():
                stk.push(i)
            elif stk.top() in hmap.keys() and i == hmap[stk.top()]:
                stk.pop()
            else:
                stk.push(i)

        if stk.isempty():
            return True
        else:
            return False
            

